import './App.css';
import{
  BrowserRowter,
  Switch,
  Route
}from "react-router-dom";
function App() {
  return (
    <BrowserRowter>
    <div className="App">
      <p>
        <link to="/">home</link>
        <link to="/about">about</link>
      </p>
    </div>
    </BrowserRowter>
  );
}

export default App;
